import React from 'react';
import ScoreBar from '../../utils/visuals/ScoreBar';

const NodeDetails = ({ node }) => (
  <div className="card mb-4">
    <div className="card-body">
      <h1 className="card-title">
        {node.title || `Node ${node.id}`}: 
        {node.statementTrueFalseFlag === null
          ? " Current statement to Prove" 
          : node.statementTrueFalseFlag 
            ? " True" 
            : " False"
        }
      </h1>
      <p className= "lead text-muted">Explanation: {node.content}</p>
      <p className="lead text-muted">Popularity: {node.popularity}</p>
      <ScoreBar 
        score={(node.score*100).toFixed(2)} 
        height={10}
        color="#4285F4"
        label="Weighted Average Score"
      />
    </div>
  </div>
);

export default NodeDetails;
